import React from "react";
import "../styles/Section2.css";

const Section2 = () => {
  return (
    <section>
      <div className="Sec2Upper">
        <h2>Latest episodes</h2>
        <button>View all episodes</button>
      </div>
      <div className="BlackRectangle">
        <div></div>
        <div></div>
      </div>
      <div className="BlackRectangle">
        <div></div>
        <div></div>
      </div>
      <div className="BlackRectangle">
        <div></div>
        <div></div>
      </div>
    </section>
  );
};

export default Section2;
